import React from 'react';
import './App.css';
// import Patient from "./components/Patient";
import SearchBar from './components/SearchBar/SearchBar.jsx';
import AddPokemonButton from './components/AddPokemonButton/AddPokemonButton';
import AddTrainerButton from './components/AddTrainerButton/AddTrainerButton';
import DeleteTrainerButton from './components/DeleteTrainerButton/DeleteTrainerButton';
import DeletePokemonButton from './components/DeletePokemonButton/DeletePokemonButton';
import TrainerModal from './components/TrainerModal/TrainerModal';
import TrainerForm from './components/TrainerForm/TrainerForm';


function App() {
  return (
    <div className="App">
      <SearchBar/>
      <AddPokemonButton/>
      <AddTrainerButton/>
      <DeleteTrainerButton/>
      <DeletePokemonButton/>
      <TrainerModal/>
      <TrainerForm/>
    </div>
  );
}

export default App;
